import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

function Fetch() {
  const [data, setData] = useState([]);
  const [selectedAwb, setSelectedAwb] = useState("");

  useEffect(() => {
    const fetchData = () => {
      fetch("http://172.22.81.182:8080/rfid/getall")
        .then((response) => response.json())
        .then((actualData) => {
          console.log(actualData);
          setData(actualData);
        })
        .catch((err) => {
          console.error("Error fetching data:", err);
        });
    };

    fetchData();
  }, []);

  const handleTrackClick = (awb) => {
    setSelectedAwb(awb);
  };

  return (
    <div>
      <h1>Shipping Data</h1>
      <table className="table">
        <thead>
          <tr>
            <th>Awb</th>
            <th>Sender Data</th>
            <th>Dimensions</th>
            <th>Destination Details</th>
            <th>Track</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.awb}</td>
              <td>{item.sender_data}</td>
              <td>{item.dimensions}</td>
              <td>{item.destination_details}</td>
              <td>
                <Link to={`/progress/${item.awb}`}>
                  <button
                    className="btn btn-neutral"
                    onClick={() => handleTrackClick(item.awb)}
                  >
                    Track
                  </button>
                </Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Fetch;
